import React from 'react'
import { Route, Routes, Link } from 'react-router-dom'
import './'

import AdminHome from './AdminHome';
import ViewJobSeekers from './ViewJobSeekers';
import AddRecruiter from './AddRecruiter';
import ViewRecruiters from './ViewRecruiters';

export default function AdminNavBar() 
{
  return (
    <div>

    <nav>
     <ul>
     <Link to="/">Home</Link>
     <Link to="/viewjobseekers">View Job Seekers</Link>
     <Link to="/addrecruiter">Add Recruiter</Link>
     <Link to="/viewrecruiters">View Recruiters</Link>
     </ul>
     </nav>

         <Routes>
         <Route path="/" Component={AdminHome} exact/>
         <Route path="/viewjobseekers" Component={ViewJobSeekers} exact/>
         <Route path="/addrecruiter" Component={AddRecruiter} exact/>
         <Route path="/viewrecruiters" Component={ViewRecruiters} exact/>
        </Routes>

    </div>
  )
}
